package com.wq.alg0409e;

import java.util.HashMap;
import java.util.Map;

/**
 * @author qiwu
 * xxxFor example,
		s = "anagram", t = "nagaram", return true.
		s = "rat", t = "car", return false.
 *Date:2017-04-09 15:24
 */
public class Solution {
    public static boolean isAnagram(String s, String t) {
	 if(null==t||null==s) return false;
	 if(t.length()!=s.length()) return false;
	 Map<Character,Integer>tmap=new HashMap<Character,Integer>();
	 Map<Character,Integer>smap=new HashMap<Character,Integer>();
     makeCharMap(tmap,t);
     makeCharMap(smap,s);
     System.out.println("tmap:"+tmap.toString());
     System.out.println("smap:"+smap.toString());

     if(tmap.keySet().size()!=smap.keySet().size()){
    	 return false;
     }
     for(char c:tmap.keySet()){
    	 if(!smap.containsKey(c)) return false;
    	 if(!tmap.get(c).equals(smap.get(c))){
//             System.out.println("haha:"+c+",tmap:"+tmap.get(c)+",smap:"+smap.get(c)+","+(tmap.get(c)!=smap.get(c)));
    		 return false;
    	 }
     }
	 return true;
    }

	private static void makeCharMap(Map<Character, Integer> map, String str) {
		for(char c:str.toCharArray()){
			if(!map.containsKey(c)){
				map.put(c, 1);
			}else{
				int count=map.get(c);
				count++;
				map.put(c, count);
			}
		}
	}
public static void main(String[] args) {
	//System.out.println(isAnagram("anagram","nagaram"));
	System.out.println(isAnagram(""
,""
));

}

}
